import classes from './Header.module.css'


const Header = () => {
    return (
        <div className={`${classes.header}`}>
            <h2>ReactMeals</h2>
            <button>Your Cart
                <div className={`${'.items-number'}`}></div>
            </button>
        </div>
    );
};

export default Header;
